export interface Category {
  id: number;
  name: string;
}

export const categories = [
  {
    id: 2,
    name: 'Smartphone'
  },
  {
    id: 3,
    name: 'Laptop'
  },
  {
    id: 4,
    name: 'Headphones'
  },
  {
    id: 5,
    name: 'Appliances'
